  display: flex;
  background-color: ${(props) => props.theme.colors.gray.light};
  padding: ${(props) => props.theme.spacing.sm}px 0;
  justify-content: space-between;
`;

const Navigation = () => {
  return <Container>Text</Container>;
};

export default Navigation;
